description:
Mostly in EPUB or MOBI format with some PDFs. Brought to you by the HYPATIA library. 

We recommend Calibre ( https://calibre-ebook.com/ ) to read and convert ebooks. It is completely free and available for Windows, Mac and Linux.

The HYPATIA library is founded on the belief that information should be free and that the intellectual and cultural development of society should not be hindered by financial constraints. If you find value in any of the works provided and have the financial means to do so, please purchase them through legitimate channels.

&#x201C;I declare after all there is no enjoyment like reading! How much sooner one tires of any thing than of a book! -- When I have a house of my own, I shall be miserable if I have not an excellent library.&#x201D; 
&#x2015; Jane Austen, Pride and Prejudice

&#x201C;It is what you read when you don&apos;t have to that determines what you will be when you can&apos;t help it.&#x201D; 
&#x2015; Oscar Wilde

&#x201C;You don&apos;t have to burn books to destroy a culture. Just get people to stop reading them.&#x201D; 
&#x2015; Ray Bradbury

&#x201C;Let us read, and let us dance; these two amusements will never do any harm to the world.&#x201D; 
&#x2015; Voltaire

&#x201C;I cannot remember the books I&apos;ve read any more than the meals I have eaten; even so, they have made me.&#x201D; 
&#x2015; Ralph Waldo Emerson

&#x201C;I find television very educating. Every time somebody turns on the set, I go into the other room and read a book.&#x201D; 
&#x2015; Groucho Marx
